import time
from enum import Enum

test_string = '''dabAcCaCBAcCcaDA'''

string = ''''''


class Polarity(Enum):
    Positive = 'positive'
    Negative = 'negative'


class Unit:
    def __init__(self, s: str):
        self.unit = s
        self.type = s.upper()
        self.polarity = self._get_polarity()

    def _get_polarity(self):
        if self.unit == self.type:
            return Polarity.Positive
        return Polarity.Negative

    def __repr__(self):
        return self.unit

def react_polymer(polymer):
    num_units = len(polymer)

    reactable = True
    skip=False
    while reactable:
        for i in range(num_units -1, 0, -1):
            if skip:
                skip=False
                continue
            unit = polymer[i]
            adjacent_unit = polymer[i - 1]
            if unit.type == adjacent_unit.type:
                if unit.polarity != adjacent_unit.polarity:
                    react(polymer, i)
                    if i == len(polymer)+1:
                        skip=True
        if num_units == len(polymer):
            reactable = False
        num_units = len(polymer)
    return polymer

def react(polymer, idx):
    polymer = polymer
    polymer.pop(idx)
    polymer.pop(idx - 1)

def polymerise(s):
    return [Unit(x) for x in s]


def run1():
    polymer = polymerise(string)
    polymer = react_polymer(polymer)
    return len(polymer)


def run2():
    STRING=string
    unique_units = set(i.lower() for i in STRING)
    minimum_length = len(STRING)
    for unique in unique_units:
        new_string = STRING.replace(unique.lower(),'').replace(unique.upper(),'')
        polymer = polymerise(new_string)
        reacted_polymer = react_polymer(polymer)
        poly_len = len(reacted_polymer)
        if poly_len <minimum_length:
            minimum_length = poly_len
    return minimum_length

if __name__ == "__main__":
    a = time.time()
    f = run1()
    g = run2()
    print(time.time() - a)
    print(f"units left in polymer", f)
    print(f"minimum length polymer", g)
